○家の中の台風対策
・窓や雨戸をしめ、窓ガラスが割れたときの飛散を防ぐために飛散防止フィルムを貼っておく。
・外からの物が飛んできた場合に備え、カーテンやブラインドを閉めておく。
・停電時に備え、携帯ラジオ、懐中電灯、ローソクなどを用意しておく。
・避難が必要になったときに備え、防災グッズや水、食料などを用意しておく。
・近所の避難場所と避難経路を確認しておく。
・市区町村が作成している「ハザードマップ」で危険箇所を確認しておく。

